import React from 'react';
import ProfilePost from './ErrorMessage/ProfilePost';


export default function ProfileFeed({posts}) {
    return(
        <>
        {posts.map((post) => {
            return <ProfilePost post={post} key={post._id} />
        })}

        </>
    )
}
